import React from "react";
import logo from "../Resources/logo.png";

const Navbar = () => {
  return (
    <div className="flex p-2 items-center justify-between ">
      <div className="flex bg-red-400">
        <img src={logo} alt="Logo" className="w-14 h-14" />
        <div className="w-fit bg-red-500">
          <p>Faculty Of Technology</p>
          <p>Faculty Of Technology</p>
        </div>
      </div>

      <div className="flex px-6 gap-10 align-middle justify-center w-full bg-red-600">
        <a href="www.google.com">Home</a>
        <a href="www.google.com">Facilities</a>
        <a href="www.google.com">Staff</a>
        <a href="www.google.com">Download</a>
        <a href="www.google.com">About</a>
      </div>
    </div>
  );
};

export default Navbar;
